import React from 'react'


const Tasks = (props) => {

    return (
        <div>
            <ul>
                {props.tasks.map(task => 
                    <li key={task.id}>
                        {task.content}
                    </li>
                )}
            </ul>
        </div>
    )
}


export default Tasks
